import React from "react";
import "../App.scss";
import "../css/Projects.scss";
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const projectsStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    icon: {
      padding: theme.spacing(10),
      textAlign: "center",
      color: theme.palette.text.secondary
    }
  })
);

function Projects() {
  const projectsStyle = projectsStyles();

  return (
    <div id="projects" className="padding-top-btm-4e">
      <div>
        <p className="menu-name">PROJECTS</p>
      </div>
      <Grid container spacing={2}>
        <Grid item xs={12} md={1}></Grid>
        <Grid item xs={12} md={5}>
          <div>
            <img src="/img/blogpage.png" alt="블로그페이지 이미지" className="projects-img"/>
          </div>
        </Grid>
        <Grid item xs={12} md={5}>
          <Paper className={projectsStyle.icon}>
            <div>
              <p>블록그페이지</p>
            </div>
          </Paper>
        </Grid>
        <Grid item xs={12} md={1}></Grid>
      </Grid>

    </div>
  );
}

export default Projects;
